import React, { useState, useEffect } from "react";
import { Dialog, DialogTitle, Container, Grid, TextField } from "@material-ui/core";

export default function Servicos({open, servicoId, close}){
  const [servico, setServico] = useState({
    nome: "",
    preco: 0,
    tempo:  0
  });

  return(
    <Dialog onClose={() => close(false)} aria-labelledby="simple-dialog-title" open={open}>
      <DialogTitle id="simple-dialog-title">Cadastro de Servi√ßos</DialogTitle>
      <form>
        <Container>
          <Grid container spacing={3}>
            <Grid item xs={6}>
              <TextField
                fullWidth
                lable="nome"
                id="nome"
                variant="outlined"
                value={servico.nome}
                onChange={event => setServico({...servico, nome: event.target.value})}
              />
            </Grid>
          </Grid>
        </Container>
      </form>
    </Dialog>
  )
}
